import React, { Component } from "react";
import "./styles/main.css";
import Logo from "./assets/icons/enneagram.svg";

export default class App extends Component {
  render() {
    return (
      <div>
        <section className="welcome">
          <div className="welcome-container">
            <span className="welcome-container__header">ENNEAFY</span>
            <img className="welcome-container__logo" src={Logo} alt="logo" />
            <span className="welcome-container__text">Enneafy bla bla bla bla bla bla bla bla</span>
            <button className="welcome-container__text"></button>
          </div>
        </section>
      </div>
    );
  }
}
